import styled from 'styled-components'


const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;

  padding: 2em 5em;

  .itens {
    display: flex;
    flex-direction: column;
    width: 100%;
  }
`


export { Container }
